// comparison.tsx
import React, { FC, useState, useEffect } from 'react';
import { Modal, ModalContent, CloseButton } from './comparison.styled';
import Search from '../searchnum/searchnum';
import PaginaCards from '../pca/pca';
import CardHar from '../harCardCar/harCardCar';
import standartCarImg from '../../img/standartcar.jpg'

interface ComparisonProps {
  onClose: () => void;
}

interface CardHarProps {
  num: string;
  img: string;
  brand: string;
  model: string;
  modelyear: string;
  color: string;
  fuel: string;
  type_car: string;
  weight: string;
}

interface Car{
  comments: string[];
  digits: string;
  is_stolen: boolean;
  model: string;
  model_year: number;
  operations: Array<any>;
  photo_url: string;
  region: {
    name: string;
    name_ua: string;
    slug: string;
    old_code: string;
    new_code: string;
  };
  stolen_details: any;
  vendor: string;
  vin: string;
}


const Comparison: FC<ComparisonProps> = ({ onClose }) => {
  const [carData, setCarData] = useState<Car | null | string>(null);
  const [searchNomer, setSearchNomer] = useState<string>("");
  const [carData1, setCarData1] = useState<Car | null | string>(null);
  const [searchNomer1, setSearchNomer1] = useState<string>("");


  return (
    <Modal>
      <CloseButton onClick={onClose}>Закрыть</CloseButton>
      <ModalContent>
        <Search setDataFromSearch={setCarData} setNomer={setSearchNomer} />
        <CardHar
        num={searchNomer}
        img={typeof carData != "string" && carData !=  null ? carData.photo_url:standartCarImg}      
        brand={typeof carData != "string" && carData !=  null ? carData.photo_url:standartCarImg}
        model={typeof carData != "string" && carData !=  null ? carData.model:""}
        modelyear={typeof carData != "string" && carData !=  null ? carData.model_year.toString():""}
        color={typeof carData != "string" && carData !=  null ? carData.operations[0].color.ru:""}
        fuel={typeof carData != "string" && carData !=  null ? carData.operations[0].fuel.ru: ""}
        type_car={typeof carData != "string" && carData !=  null ? carData.operations[0].kind.ru:""}
        weight={typeof carData != "string" && carData !=  null ? carData.operations[0].own_weight:""}
        />
      </ModalContent>
      <ModalContent>
        <Search setDataFromSearch={setCarData1} setNomer={setSearchNomer1} />
        <CardHar
        num={searchNomer1}
        img={typeof carData1 != "string" && carData1 !=  null ? carData1.photo_url:standartCarImg}      
        brand={typeof carData1 != "string" && carData1 !=  null ? carData1.photo_url:standartCarImg}
        model={typeof carData1 != "string" && carData1 !=  null ? carData1.model:""}
        modelyear={typeof carData1 != "string" && carData1 !=  null ? carData1.model_year.toString():""}
        color={typeof carData1 != "string" && carData1 !=  null ? carData1.operations[0].color.ru:""}
        fuel={typeof carData1 != "string" && carData1 !=  null ? carData1.operations[0].fuel.ru: ""}
        type_car={typeof carData1 != "string" && carData1 !=  null ? carData1.operations[0].kind.ru:""}
        weight={typeof carData1 != "string" && carData1 !=  null ? carData1.operations[0].own_weight:""}
        />
      </ModalContent>
    </Modal>
  );
};

export default Comparison;
